import React, { Component } from 'react'

export default class Table extends Component {
    render() {
        let tableCols = Object.getOwnPropertyNames(this.props.data[0]);
        return (
            <table style={tableStyle}>
                <tbody>
                    <tr>
                    {
                        tableCols.map((val,index) => <th key={index}>{val}</th>) 
                    }
                    </tr>
                    {
                        this.props.data.map((val, index) =>{
                            return(
                                <tr key={index}>
                                    <th>{val.Class}</th>
                                    <th>{val.Date}</th>
                                    <th>{val.Instructor}</th>
                                    <th>{val.Subject}</th>    
                                </tr>
                            )
                        })
                    }
                </tbody>
            </table>
        )
    }
}

const tableStyle = {
    border:'1px solid black',
    borderCollapse:'collapse',
    textAlign:'left',
    borderSpacing:'10px',
}
